import React, { useState } from 'react';

function RegistrationForm() {
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');
    const [message, setMessage] = useState('');

    const handleSubmit = async (event) => {
        event.preventDefault();

        try {
            const response = await fetch('/register', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify({ username, password })
            });

            if (response.ok) {
                setMessage('User registered successfully');
                setUsername('');
                setPassword('');
            } else {
                const data = await response.json();
                setMessage(data.error || 'Failed to register user. Please try again later.');
            }
        } catch (error) {
            console.error('Error:', error);
            setMessage('Failed to register user. Please try again later.');
        }
    };

    return (
        <div>
            <h1>User Registration</h1>
            <form onSubmit={handleSubmit}>
                <label htmlFor="username">Username:</label>
                <input type="text" id="username" value={username} onChange={(e) => setUsername(e.target.value)} required /><br /><br />
                <label htmlFor="password">Password:</label>
                <input type="password" id="password" value={password} onChange={(e) => setPassword(e.target.value)} required /><br /><br />
                <button type="submit">Register</button>
            </form>
            <div>{message}</div>
        </div>
    );
}

export default RegistrationForm;
